void draw_background();

int main(void)
{
    srand(time(NULL));
    int i,j;
    // setup PS/2 port
    unsigned char byte1 = 0;
    unsigned char byte2 = 0;
    unsigned char byte3 = 0;

   // volatile int *HEX_ptr = (int *)HEX3_HEX0_BASE; // HEX display address

    volatile int *PS2_ptr = (int *)PS2_BASE; // PS/2 port address
    int PS2_data, RVALID;

    // setup graphics
    volatile int *pixel_ctrl_ptr = (int *)0xFF203020;

    /* set front pixel buffer to start of FPGA On-chip memory */
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the
                                        // back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // pixel_buffer_start points to the pixel buffer
    /* set back pixel buffer to start of SDRAM memory */
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
    clear_screen();                             // pixel_buffer_start points to the pixel buffer

    // main loop
    while (1)
    { 
        printf("%d\n", player1.invincible);
        //printf("health = %d\n",player1.health);

        // write num_points to HEX display
        //*HEX_ptr = num_points;
        // num_points = 105;
        if (num_points < 10)
        {
            *HEX = seg7[num_points];
        }
        else if (num_points < 100)
        {
            int a, b;
            a = num_points % 10;
            b = (num_points - a) / 10;
            *HEX = (seg7[b] << 8) | seg7[a];
        }
        else if (num_points < 1000)
        {
            int m, n, o;
            m = (num_points % 100) % 10;
            n = (num_points % 100 - i) / 10;
            o = (num_points - 10 * j - i) / 100;
            *HEX = (seg7[o] << 16) | (seg7[n] << 8) | seg7[m];
        }

        // PS/2 keyboard input
        PS2_data = *(PS2_ptr);        // read the Data register in the PS/2 port
        RVALID = (PS2_data & 0x8000); // extract the RVALID field
        if (RVALID != 0)
        {
            /* always save the last three bytes received */
            byte1 = byte2;
            byte2 = byte3;
            byte3 = PS2_data & 0xFF;
            // printf("byte1 is %d, byte2 is %d, byte3 is %d \n", byte1, byte2, byte3);
        }

        if (title_screen)
        {
            draw_title_screen();
            if (start_text_counter < 4) {
                draw_start_text();
                start_text_counter += 1;
            } else {
                start_text_counter += 1;
                if (start_text_counter == 8) start_text_counter = 0;
            }
            if (byte3 == 0x5A)
            {
                title_screen = false;
                clear_screen();
                title_step = true;
                initialize_game();
                draw_background();
            }
        }

        else if (player1.isAlive || restart)
        {
            restart = false;
            if (title_step)
            {
                clear_screen();
                draw_background();
                title_step = false;
            }


            clear_healthBar(healthBar.prev2_x, healthBar.prev2_y);
            clear_healthBar(green_health.prev2_x, green_health.prev2_y);
            replace_background(player1.prev2_x, player1.prev2_y, 34, 34);
        
            // draw and update projectiles
            for (i = 0; i < MAX_PROJECTILES; i++) {
                replace_background(projectiles[i].prev2_x, projectiles[i].prev2_y, 40, 40);
                if (projectiles[i].isActive) {
                    //clean_projectile(projectiles[i].prev2_x, projectiles[i].prev2_x, projectiles[i].direction);
                    draw_projectile(projectiles[i].x, projectiles[i].y, projectiles[i].direction);
                } 

                if (!projectiles[i].isActive) {
                    shoot_projectile(byte1, byte2, byte3, &projectiles[i], player1);
                    if (projectiles[i].death_frame == 0) projectiles[i].death_frame += 1;
                    
                    if (projectiles[i].death_frame > 0 && projectiles[i].death_frame < 3) {
                        clean_barrell(projectiles[i].x, projectiles[i].y);
                        projectiles[i].death_frame += 1;
                    }
                }

                save_twoframes(&projectiles[i].prev_x, &projectiles[i].prev_y, &projectiles[i].prev2_x, &projectiles[i].prev2_y, projectiles[i].x, projectiles[i].y);
                update_projectile(&projectiles[i], &player1);
            }

			for (i = 0; i < MAX_ZOMBIES; i++)
            {
                update_zombie = !update_zombie;

                if (!zombies[i].isAlive)
                {
                    //printf("here\n");
                    zombie_buffer += 1;
                    if (zombies[i].death_frame < 2) {
                        clean_zombie(zombies[i].prev2_x, zombies[i].prev2_y);
                        clean_zombie(zombies[i].x, zombies[i].y);
                        zombies[i].death_frame += 1;
                    } else if (zombie_buffer == 100) {
                        struct zombie z = spawn_zombie(i);
                        zombies[i] = z;
                        zombie_buffer = 0;
                    }
                }

                else if (zombies[i].isAlive)
                {
                    if (update_zombie)
                    {
                        zombie_movement(i, &player1);
                    }
                    clean_zombie(zombies[i].prev2_x, zombies[i].prev2_y);           					
                    draw_zombie(zombies[i].x, zombies[i].y, zombies[i].direction);
                }
                save_twoframes(&zombies[i].prev_x, &zombies[i].prev_y, &zombies[i].prev2_x, &zombies[i].prev2_y, zombies[i].x, zombies[i].y);
            }

            //  draw and clean barrells
            for (i = 0; i < MAX_BARRELLS; i++)
            {
                if (barrells[i].isActive)
                {
                    draw_barrell(barrells[i].x, barrells[i].y);
                }
                if (!barrells[i].isActive) {
                    barrell_buffer += 1;
                    if (barrells[i].death_frame < 5) {
                        clean_barrell(barrells[i].x, barrells[i].y);
                        draw_explosion(barrells[i].x, barrells[i].y);
                        barrells[i].death_frame += 1;
                    } else if (barrells[i].death_frame < 7) {
                        clean_explosion(barrells[i].x, barrells[i].y);
                        barrells[i].death_frame += 1;
                    } else if (barrell_buffer >= 400) {
                        struct barrell b = spawn_barrell(i);
                        barrells[i] = b;
                        barrell_buffer = 0;

                    }

                }

            }
            if (player1.isAlive)
                draw_player(player1.x, player1.y, player1.direction);
            if (player1.invincible)
            {
                invincibility_counter += 1;
                if (invincibility_counter == 40)
                {
                    invincibility_counter = 0;
                    player1.invincible = false;
                }
            }
            // player1.health = 80;
            calculate_healthBar(&healthBar, &green_health, &player1);

            save_twoframes(&player1.prev_x, &player1.prev_y, &player1.prev2_x, &player1.prev2_y, player1.x, player1.y);
            save_twoframes(&healthBar.prev_x, &healthBar.prev_y, &healthBar.prev2_x, &healthBar.prev2_y, healthBar.x, healthBar.y);
            save_twoframes(&green_health.prev_x, &green_health.prev_y, &green_health.prev2_x, &green_health.prev2_y, green_health.x, green_health.y);


        } else {
            draw_end_screen();
			if (byte3 == 0x5A)
            {
			initialize_game();
			restart = true;
			title_screen = true;
			
			}// game over screen
        }

        // PS/2 keyboard input
        PS2_data = *(PS2_ptr);        // read the Data register in the PS/2 port
        RVALID = (PS2_data & 0x8000); // extract the RVALID field
        if (RVALID != 0)
        {
            /* always save the last three bytes received */
            byte1 = byte2;
            byte2 = byte3;
            byte3 = PS2_data & 0xFF;
            // printf("byte1 is %d, byte2 is %d, byte3 is %d \n", byte1, byte2, byte3);
        }
        player_movement(byte1, byte2, byte3, &player1);

        wait_for_vsync();                           // swap front and back buffers on VGA vertical sync
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
    }
}

