void update_projectile(struct projectile *p, struct player *play)
{
    int i, j, k;
    // update position of an active projectile
    if (p->isActive)
    {
        switch (p->direction)
        {
        case UP_CODE:
            if (p->y > 20)
                p->y = p->y - dy;
            else
                p->isActive = false;
            break;
        case DOWN_CODE:
            if (p->y < Y_BOUND - 20)
                p->y = p->y + dy;
            else
                p->isActive = false;
            break;
        case LEFT_CODE:
            if (p->x > 20)
                p->x = p->x - dx;
            else
                p->isActive = false;
            break;
        case RIGHT_CODE:
            if (p->x < X_BOUND - 20)
                p->x = p->x + dx;
            else
                p->isActive = false;
            break;
        default:
            break;
        }

        // zombie hit detection
        for (i = 0; i < MAX_ZOMBIES; i++)
        {
            if (zombies[i].isAlive && ((p->x >= zombies[i].x - 15) && (p->x <= zombies[i].x + 15)) && ((p->y >= zombies[i].y - 15) && (p->y <= zombies[i].y + 15)))
            {

                zombies[i].health -= 1; // projectile hits zombie and the zombie's health will decrease
                if (zombies[i].isAlive && zombies[i].health <= 0)
                { // if the zombie has <= 0 health then it is dead
                    zombies[i].isAlive = false;
                    num_zombies = num_zombies - 1;
                }
                p->isActive = false;
                boundary[p->x][p->y] = EMPTY_CODE;
                num_points += 1;
                break;
            }
        }
		// barrell hit detection
        for (j = 0; j < MAX_BARRELLS; j++)
        {
            if (barrells[j].isActive && ((p->x >= barrells[j].x - 8) && (p->x <= barrells[j].x + 11)) && ((p->y >= barrells[j].y - 8) && (p->y <= barrells[j].y + 11)))
            {
                barrells[j].isActive = false;
                num_barrells -= 1;
                for (k = 0; k < MAX_ZOMBIES; k++)
                {
                    if (zombies[k].isAlive && ((barrells[j].x >= zombies[k].x - EXPLOSION_RADIUS) && (barrells[j].x <= zombies[k].x + EXPLOSION_RADIUS)) && ((barrells[j].y >= zombies[k].y - EXPLOSION_RADIUS) && (barrells[j].y <= zombies[k].y + EXPLOSION_RADIUS)))
                    {
                        zombies[k].isAlive = false;
                        num_zombies = num_zombies - 1;
                        num_points += 1;
                    }
                }

                if (((barrells[j].x >= play->x - EXPLOSION_RADIUS) && (barrells[j].x <= play->x + EXPLOSION_RADIUS)) && ((barrells[j].y >= play->y - EXPLOSION_RADIUS) && (barrells[j].y <= play->y + EXPLOSION_RADIUS))) {
                    play->health -= 10;
                    play->invincible = true;
                    if (play->health <= 0)
                    {
                        play->isAlive = false;
                    }
                }
                p->isActive = false;
                break;
            }
            boundary[p->x][p->y] = EMPTY_CODE;
        }
    }
}

void shoot_projectile(int byte1, int byte2, int byte3, struct projectile *p, struct player play)
{
    if (byte1 == byte3 && byte2 == 0xF0)
        ;

    // when I is pressed, initialize the starting position of the projectile and set it to active
    else if (byte3 == I_PRESS && !p->isActive)
    {
        // printf("projectile has been launched\n");
        boundary[p->x][p->y] = EMPTY_CODE;
        p->x = play.x;
        p->y = play.y;
        p->direction = play.direction;
        p->isActive = true;
        boundary[p->x][p->y] = PROJECTILE_CODE;
    }
}

void player_movement(int byte1, int byte2, int byte3, struct player *p)
{
    if (byte2 == 0xF0) // user let go of key
    { 
        return;
    }

    // standard movement
    if (byte3 == W_PRESS)
    { // W pressed, go up
        if (p->y >= 25)
        {
            boundary[p->x][p->y] = EMPTY_CODE;
            p->y = p->y - dy;
            boundary[p->x][p->y] = PLAYER_CODE;
        }
        p->direction = 0;
        *RLEDs = 1;
    }
    else if (byte3 == S_PRESS)
    { // S pressed, go down
        if (p->y <= Y_BOUND - 32)
        {
            boundary[p->x][p->y] = EMPTY_CODE;
            p->y = p->y + dy;
            boundary[p->x][p->y] = PLAYER_CODE;
        }
        p->direction = 1;
        *RLEDs = 2;
    }
    else if (byte3 == A_PRESS)
    { // A pressed, go left
        if (p->x >= 25)
        {
            boundary[p->x][p->y] = EMPTY_CODE;
            p->x = p->x - dx;
            boundary[p->x][p->y] = PLAYER_CODE;
        }
        p->direction = 2;
        *RLEDs = 4;
    }
    else if (byte3 == D_PRESS)
    { // D pressed, go right
        if (p->x < X_BOUND - 25)
        {
            boundary[p->x][p->y] = EMPTY_CODE;
            p->x = p->x + dx;
            boundary[p->x][p->y] = PLAYER_CODE;
        }
        p->direction = 3;
        *RLEDs = 8;
    }
}

