void wait_for_vsync()
{
    volatile int *pixel_ctrl_ptr = (int *)PIXEL_BUF_CTRL_BASE;
    int status;
    // set S bit to 1
    *pixel_ctrl_ptr = 1;
    // pixel_ctrl_ptr + 3 => 0xFF20302C

    status = *(pixel_ctrl_ptr + 3);
    // while (S == 1)
    while ((status & 0x01) != 0)
    {
        status = *(pixel_ctrl_ptr + 3);
    }
    return;
}

