void swap(int *xp, int *yp)
{
    int temp = *xp;
    *xp = *yp;
    *yp = temp;
}
void draw_line(int x0, int y0, int x1, int y1, short int color)
{
    bool is_steep = abs(y1 - y0) > abs(x1 - x0);
    int y_step;

    if (is_steep)
    {
        swap(&x0, &y0);
        swap(&x1, &y1);
    }

    if (x0 > x1)
    {
        swap(&x0, &x1);
        swap(&y0, &y1);
    }

    int deltax = x1 - x0;
    int deltay = abs(y1 - y0);
    int error = -(deltax / 2);
    int y = y0;

    if (y0 < y1)
    {
        y_step = 1;
    }
    else
    {
        y_step = -1;
    }

    // for x from x0 to x1
    for (int x = x0; x <= x1; x++)
    {
        if (is_steep)
        {
            plot_pixel(y, x, color);
        }
        else
        {
            plot_pixel(x, y, color);
        }

        error = error + deltay;

        if (error > 0)
        {
            y = y + y_step;
            error = error - deltax;
        }
    }
}

void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

// draw 3x3 box centered at (x,y)
void draw_box(int x, int y, int w, short int color)
{
    int i, j;
    for (i = 0; i <= w; i++)
    {
        for (j = 0; j <= w; j++)
        {
            plot_pixel(x - i, y - j, color);
            plot_pixel(x - i, y + j, color);
            plot_pixel(x + i, y - j, color);
            plot_pixel(x + i, y + j, color);
        }
    }
}

// draw w x l box centered at (x,y)
void replace_background(int x, int y, int w, int l)
{
    int i, j;
    for (i = 0; i <= w/2; i++)
    {
        for (j = 0; j <= l/2; j++)
        {
            plot_pixel(x - i, y - j, background[y - j][x - i]);
            plot_pixel(x - i, y + j, background[y + j][x - i]);
            plot_pixel(x + i, y - j, background[y - j][x + i]);
            plot_pixel(x + i, y + j, background[y + j][x + i]);  
        }
    }
}
	
	
	